        urlType
      }
      trackingEvent
    }
  }
}","variables":{"collection":"blta2bfff8ae876ae60"},"operationName":"GetTileCollection"}

{"query":"query FetchShippingAddress($addressId: String, $addressType: AddressType, $namespace: String) {
  addresses(addressType: $addressType, id: $addressId, namespace: $namespace) {
    shipping {
      id
      isDefault
      address {
        fields {
          key
          value
        }
      }
      formatted {
        raw {
          address {
            firstName
            lastName
            address1
            address2
            city
            region
            country
            postalCode
            phone
          }
          display
        }
        parsed {
          address {
            firstName
            lastName
            address1
            address2
            city
            region
            country
            postalCode
            phone
          }
          display
        }
      }
    }
  }
}","variables":{"addressType":"SHIPPING","namespace":"stockx"},"operationName":"FetchShippingAddress"}

{"query":"query RecentlyViewedProducts($type: ProductSelectionType!, $limit: Int!, $country: String!, $currencyCode: CurrencyCode!, $marketName: String) {
  allProducts(type: $type, page: {page: 0, limit: $limit}) {
    edges {
      node {
        id
        listingType
        title
        brand
        productCategory
        name
        urlKey
        uuid
        gender
        browseVerticals
        ...FavoriteProductFragment
        variants {
          id
        }
        media {
          smallImageUrl
        }
        market(currencyCode: $currencyCode) {
          state(country: $country, market: $marketName) {
            lowestAsk {
              amount
            }
            askServiceLevels {
              expressExpedited {
                count
                lowest {
                  amount
                  inventoryType
                }
              }
              expressStandard {
                count
                lowest {
                  amount
                  inventoryType
                }
              }
            }
          }
          salesInformation {
            lastSale
          }
        }
      }
    }
  }
}

fragment FavoriteProductFragment on Product {
  favorite
}","variables":{"country":"US","currencyCode":"USD","limit":20,"type":"RECENTLY_VIEWED","marketName":null},"operationName":"RecentlyViewedProducts"}

{"query":"query FetchProductCollection($id: String, $country: String!, $currencyCode: CurrencyCode!, $limit: Int!, $marketName: String, $page: Int!) {
  productCollection(id: $id) {
    tileType
    priceType
    footnotesType
    trackingEvent
    helpMessage
    ...ResultsFragment
    seeAllCTA {
      title
      url
      urlType
    }
    title
  }
}

fragment ResultsFragment on ProductCollection {
  results(page: $page, market: $marketName, limit: $limit, placement: HOME) {
    edges {
      isAd
      adIdentifier
      adInventoryId
      adServiceLevel
      node {
        ... on Product {
          ...HomeProductDetailsFragment
        }
        ... on Variant {
          __typename
          id
          sizeChart {
            baseSize
            baseType
            displayOptions {
              size
              type
            }
          }
          product {
            ...HomeProductDetailsFragment
          }
          market(currencyCode: $currencyCode) {
            ...HomeMarketFragment
          }
          ...FavoriteVariantFragment
        }
      }
    }
    pageInfo {
      total
    }
  }
}

fragment HomeProductDetailsFragment on Product {
  __typename
  id
  title
  brand
  browseVerticals
  gender
  productCategory
  categories {
    default {
      alias
    }
  }
  primaryCategory
  listingType
  name
  urlKey
  uuid
  sizeDescriptor
  ...FavoriteProductFragment
  variants {
    id
  }
  media {
    smallImageUrl
  }
  market(currencyCode: $currencyCode) {
    state(country: $country, market: $marketName) {
      askServiceLevels {
        expressExpedited {
          count
          lowest {
            amount
            inventoryType
          }
        }
        expressStandard {
          count
          lowest {
            amount
            inventoryType
          }
        }
      }
    }
    ...HomeMarketFragment
  }
  traits(filterTypes: [RELEASE_DATE, RETAIL_PRICE]) {
    name
    value
  }
}

fragment HomeMarketFragment on Market {
  currencyCode
  state(country: $country, market: $marketName) {
    highestBid {
      amount
      updatedAt
    }
    lowestAsk {
      amount
      updatedAt
    }
    askServiceLevels {
      expressExpedited {
        lowest {
          amount
          inventoryType
        }
      }
      expressStandard {
        lowest {
          amount
          inventoryType
        }
      }
    }
  }
  statistics {
    lastSale {
      amount
    }
    last72Hours {
      salesCount
    }
    annual {
      salesCount
    }
    last90Days {
      averagePrice
      salesCount
    }
  }
}

fragment FavoriteProductFragment on Product {
